    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["timestamp", "mac", "rssi_1", "rssi_2", "rssi_3", "x", "y"];
    let aliases = ["timestamp", "mac", "rssi_1", "rssi_2", "rssi_3", "x", "y"];

    +'</table>';
    div.innerHTML=table;
    
    return div
    }
